import React from "react";
import { Link, NavLink } from "react-router-dom";
import './'

const Header = () => {
  return (
    <header>
      <nav>
        <ul>
          <li>
            <NavLink
              to="/"
              className={({ isActive }) => `${isActive ? "acitve" : "inactive"}`
              }
            >
              Home
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/create-recipe"
              className={({ isActive }) => {
                return `${isActive ? "acitve" : "inactive"}`;
              }}
            >
              Create Recipe
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/saved-recipe"
              className={({ isActive }) => {
                return `${isActive ? "acitve" : "inactive"}`;
              }}
            >
              Saved Recipe
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/auth"
              className={({ isActive }) => {
                return `${isActive ? "acitve" : "inactive"}`;
              }}
            >
              Login/Register
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
